import React from 'react'

function Item(props) {
  return (
    <div className='item'>
        <div className='item-icon' style={{backgroundImage: `url(${props.item.icon})`}}></div>
        <div className='item-name'>{props.item.name}</div>
    </div>
  )
}

export default Item
